vn-id: https://svn.apache.org/repos/asf/avro/trunk@1056425 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(682,'701473043802d2e54638df2c8c112af8d8d4504a',12,'2011-01-07 20:36:11','    AVRO-708. Java: Fix Netty-based RPC to keep connection open.  Contributed by Stephen Gargan.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056494 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(683,'6cac5fe1283d797f62e40b1dd755e40f5b213d7b',12,'2011-01-07 20:42:51','    AVRO-723. Java: Pass error messages for unexpected RPC exceptions through to client.  Contributed by Stephen Gargan.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056499 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(684,'ee5428d3eb38c34ef2a9ded2f0cd447fe3f2f959',12,'2011-01-07 21:19:36','    AVRO-719. Java: Permit MapReduce programs to alter output file sync interval.  Contributed by Joe Crobak.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056517 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(685,'a0d444d9eb8ffac43ecabb7476f80cbae998170a',12,'2011-01-07 21:23:55','    AVRO-694. Python: Fix schema parse error for maps of records.  Contributed by hammer.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1056519 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(686,'161206d6d49f352e1a9158f884c8020709f5b1ff',10,'2011-01-11 14:32:37','    AVRO-725. Add avro_schema_get_subschema function.\n    \n    This new function returns the immediate subschema with the given name.\n    For records, this is the name of the field.  For unions, it\'s the name\n    of the branch\'s schema type.  For arrays and maps, there is a single\n    special name (respectively \"[]\" and \"{}\") that represents the item or\n    value subschema.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057661 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(687,'02fc973f779bc18482554841abc43844562da75a',10,'2011-01-11 14:48:26','    AVRO-630. Size accessors for array and map data.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057667 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(688,'8028574ba42ff2aa8d1faf4085f84ca3d13d55b3',10,'2011-01-11 14:56:51','    AVRO-727. This patchs several missing accessor and mutator methods for Avro\n    schemas and data instances.\n    \n    For the most part, their definitions are straightforward.  Some notes for the\n    more interesting cases:\n    \n      - You can create the appropriate avro_datum_t instance for an\n        arbitrary schema with the new avro_datum_from_schema() function.\n        For records, this includes creating a datum instance for each of the\n        record\'s fields.  Arrays and maps are initially created empty, while\n        a union is created with none of its branches initially selected.\n        This prevents the function from going into an endless loop for\n        recursive schemas.\n    \n      - The active branch of a union can now be changed.  If the desired\n        branch is already active, this has no result.  Otherwise, a new\n        avro_datum_t is created for the new branch.\n    \n      - Map values can now be accessed by index as well as by key.  The\n        index of a map entry is based on the order that it was added to the\n        map.\n    \n      - Enum values can be retrieved or set either by integer value or by\n        symbol name.\n    \n    A couple of the new functions need access to the schema of a datum in\n    order to work.  These functions take in the schema instance as an extra\n    parameter.  A better solution might be to include a reference to a\n    schema object in each avro_datum_t instance.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057676 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(689,'7febb30db2f2038ab9b750457a6df016cd583a04',10,'2011-01-11 15:07:07','    AVRO-549. Custom allocator interface.\n    \n    You can now provide a custom allocation function, which the Avro library\n    will use for all of the memory that it obtains.  The allocator function\n    prototype is the same one used by the Lua interpreter; it\'s a generic\n    function that includes the functionality of malloc, realloc, and free.\n    It takes in the old pointer (ptr), the old size (osize), and the new\n    size (nsize) of the buffer.  For realloc, all three have real values.\n    For malloc, ptr will be NULL, and osize 0.  For free, nsize will be 0.\n    \n    One wrinkle is that we have to be able to provide the allocated size of\n    the buffer when we free it, since we have to provide a value for osize.\n    For most of our allocations, this isn\'t a problem, since we allocated a\n    fixed-size buffer for a struct of some kind.  It\'s also not a problem\n    for the buffers associated with a bytes or fixed field, since we have\n    the buffer size right there.  For strings, however, we have to be more\n    clever; for most cases, our strdup replacement adds additional space to\n    the buffer to store its size.  This prevents us from having to add lots\n    of additional size_t fields all over the place.  We can\'t do this in the\n    string datum, however, since the givestring methods need to be able to\n    take in an arbitrary string pointer; this means we can\'t assume it has\n    our special size prefix.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057683 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(690,'44eb7b879277cd5be5fa3f23376d299d8f4a6067',10,'2011-01-11 15:34:44','    AVRO-729. avro_schema_to_json can take const schema.\n    \n    This method doesn\'t modify the schema as it writes its JSON encoding, so\n    the schema parameter can be const.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057697 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(691,'2a3841f9419723b3007832d368a8c365d89ffd17',10,'2011-01-11 16:50:35','    AVRO-729. Part 1 of updating to Jansson 1.3.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057727 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(692,'8bb68f7949fa14c10fd2549bcae2e4ddfdb817da',10,'2011-01-11 16:53:53','    AVRO-729. Upgrading to Jansson 1.3\n    \n    This patch updates our internal copy of the Jansson library to version\n    1.3.  This is needed for the new code that will decode and encode JSON\n    versions of an Avro datum.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057728 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(693,'c69a5bb3780fcae1ca02439ef03c2f2d6188774b',10,'2011-01-11 17:15:49','    AVRO-729. Follow-on to address issues when building with CMake.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057735 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(694,'2f5d854451fc832fda13e170323c065c9b048c3c',10,'2011-01-11 17:16:12','    AVRO-729. JSON encoded Avro values.\n    \n    You can now produce the JSON-encoded version of an Avro datum.  It\n    correctly handles Avro values that produce a top-level JSON object that\n    isn\'t an array or object, even though that technically violates the JSON\n    spec.  You have to free the resulting string using the standard free()\n    function, and *not* using the custom Avro allocator, since the string\n    will be produced by the Jansson library, which doesn\'t know about our\n    custom allocator.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057736 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(695,'d88f0e4b854b5317555ad2a08c2c0b8ce4fe5b90',10,'2011-01-11 17:46:30','    AVRO-729. Follow-on to set some permissions correctly.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057764 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(696,'a2d92d73cdc29f92091ac958511ffef36d2f9e1f',10,'2011-01-11 18:16:35','    AVRO-729. Follow-on to fix further issues from Jansson update.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057781 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(697,'fe2631a02ad01d755199076f43398a770b9750f4',10,'2011-01-11 18:29:34','    AVRO-725: Follow-on to fix missing include causing warning.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057786 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(698,'4f8f908cf16850f7f6225c9359de2cbf9f770de6',12,'2011-01-11 22:26:06','    AVRO-731. Documentation: Improve identification of Apache trademarks.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1057895 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(699,'5a5a90960f2a25e98198c8845e193b47ffeb208a',11,'2011-01-14 18:31:55','    AVRO-734 Maven build could need a few plugin updates\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059100 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(700,'f036caa094c30ad39abd76e75858aee4cca0cb62',11,'2011-01-14 18:41:50','    AVRO-734. Java: Update maven build plugin versions.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059104 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(701,'d0985f9e601ba97754bf072ac77e754a6c0a8c92',11,'2011-01-14 18:44:10','    AVRO-733 Java: Checkstyle failure in SpecificResponder.java\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059105 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(702,'6076010d1b73aa9061b3a2a44f4242b6ab1d2230',11,'2011-01-14 19:41:03','    AVRO-663 Java build: Change build to create an avro-tools.jar that conforms to maven standards and contains dependencies within\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059139 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(703,'309b4a3eddea7cf386d56c7371fc11159f0bb402',11,'2011-01-14 19:46:05','    AVRO-663. Java: avro-tools.jar does not meet maven2 layout standard.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059141 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(704,'f46af6b5788544d8789bec5e8fdeb58d9d9d2d47',11,'2011-01-14 19:55:43','    AVRO-734. Java: Update maven build plugin versions.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059146 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(705,'914bdb53b61b9b65e3260459217bdf6063b9b83b',11,'2011-01-14 23:07:05','    AVRO-733 Java: change checkstyle to be bound to \'test\' rather than \'verify\' phase\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1059204 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(706,'a1eb97af3d931594b450321eb277817d186e1f50',12,'2011-01-17 20:57:54','    AVRO-688. Java: Only require that one-way\'ness of messages match over stateful connections.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1060089 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(708,'c849a8f76708f8995c311396f3933421b80bdaa7',10,'2011-01-20 11:35:56','    AVRO-740. Fix early deletion of schema during test_avro_data.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1061232 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(709,'b4f29d127108be85af3ea0f856c4ef3b52a2a798',10,'2011-01-20 12:38:19','    AVRO-736. At least let valgrind run test_avro_data on Mac OS X.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1061269 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(710,'a1e801aadba4ba65ce54b078d6c02b8617a88774',10,'2011-01-24 12:05:09','    AVRO-742. Maintain reference count for singleton objects.\n    \n    We use a singleton struct for instances of the null value type, and for\n    each of the primitive schema types.  This means that we need to increase\n    the reference count of each singleton each time the appropriate\n    constructor is called; otherwise, the reference count will get wonky\n    when we call avro_whatever_decref().  That won\'t cause any memory\n    corruption, since we never free any singleton objects, regardless of\n    what their reference counts do, but still.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062747 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(711,'26ea6ca388642f96d4d0dfab28150d6b0f51aa33',10,'2011-01-24 12:09:17','    AVRO-736. Fix running test_valgrind on Mac OS X. No need for --show-reachable=yes.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062748 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(712,'335d72590281875b500f776afd3b43fc24c1e4dc',10,'2011-01-24 16:52:09','    AVRO-745. Fixed memory bug in bytes/string/fixed values.\n    \n    The avro_bytes_set function (and its string and fixed counterparts) are\n    supposed to save a copy of the value, which the avro_datum_t instance\n    takes full control over.  Unfortunately, we were making that copy but\n    then saving the original pointer, which would lead to a segfault when\n    freeing the datum.  Whoops...\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1062872 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(713,'bd1c8fedb2c9566a9b161749fb6b49904b8caad8',10,'2011-01-26 03:44:18','    AVRO-741. The avro_give* functions now all take in a custom free function that\n    will be called once the datum no longer needs access to the underlying\n    buffer.  This gives complete flexibility over wrapping external buffers\n    into Avro datum instances.  The avro_wrap* functions have been removed,\n    since this is now just a special case — just use NULL for the free\n    function.  To get the previous behavior of avro_give* (where the buffer\n    is freed using the custom allocator), use avro_alloc_free as the free\n    function.\n    \n    In addition to updating the give functions, the binary encoding class\n    now ensures that any bytes value is NUL terminated in memory.  This\n    fixes the bug in AVRO-741, where we were getting a segfault when trying\n    to parse a schema JSON directly from a bytes value.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1063596 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(714,'9403bef4294b16c9eb59e6876f7a6fb6cecfaa0a',11,'2011-01-28 01:04:53','        AVRO-716. Java: Improve correlation between packages and modules.\n        Each module introduced by AVRO-647 now exclusively provides\n        different java packages.  This required moving several classes\n        around into new packages and will therefore require users to\n        change their package imports when upgrading to Avro 1.5.0.\n        Summary of changes:\n        * AvroRemoteException has moved to org.apache.avro\n        * ByteBufferInputStream and ByteBufferInputStream have moved\n          to org.apache.avro.util\n        * InduceSchemaTool has moved to org.apache.avro.tools\n        * SpecificCompiler, SchemaTask, and ProtocolTask have moved\n          to org.apache.avro.compiler.specific\n        * The Idl compiler has moved to org.apache.avro.compiler.idl\n        * ReflectRequestor and ReflectResponder have moved to\n          org.apache.avro.ipc.reflect\n        * GenericRequestor and GenericResponder have moved to\n          org.apache.avro.ipc.generic\n        * SpecificRequestor and SpecificResponder have moved to\n          org.apache.avro.ipc.specific\n        (scottcarey)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1064397 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(715,'330e7fb6c2708b4dba775d9bad05a62b0ce2146e',5,'2011-01-30 19:10:51','    AVRO-700. Change C++ build system to CMake\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1065352 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(716,'7fedde60b8704c2715526f6da81d6c43c4ca03e3',10,'2011-01-31 12:29:27','    AVRO-749. Don\'t install Jansson files.\n    \n    Our copy of the Jansson library should be strictly internal, but the\n    autotools build was installing Jansson\'s include and pkg-config files\n    along with the Avro library.  Now it doesn\'t.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1065580 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(717,'5ca4688a84af2406da81c0915ef781a790a016cb',11,'2011-02-01 19:08:24','    AVRO-752. Java: Enhanced Performance Test Suite\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1066139 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(719,'214803f7333fa6681caf0c36abf5899b7e861992',11,'2011-02-01 19:24:40','    AVRO-716. Java: integrate AVRO-647 changes with top level build\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1066155 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(720,'9a34604d54723f44660d71d3e0ecd609fbf7d8a1',11,'2011-02-07 18:37:16','    AVRO-743 Java: Performance Regression and memory pressure with GenericDatumReader\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068045 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(721,'0011118ad62f56a42559fb432c2d46155649ade9',12,'2011-02-07 21:21:01','    AVRO-757. Java: Permit data files to be re-opened without re-reading the header.  Contributed by Stu Hood.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068142 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(722,'e020bbab1ba977e7b2f0cd0693d0d20c2c73441f',11,'2011-02-09 01:38:00','    AVRO-752. Java: Enhanced Performance Test Suite\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1068726 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(723,'555df469c341e8aedc6a4a2822735edeed8ec095',11,'2011-02-14 19:10:52','    AVRO-765. Java: Improvement to BinaryDecoder readLong performance\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070613 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(724,'4becf049d94e442f0b7aed95d61cc7574454f96c',13,'2011-02-15 15:26:23','    AVRO-750. C: Install pkg-config file\n    \n    This patch adds a pkg-config description file for the Avro library.\n    Makes it easier to determine the right CPPFLAGS and LDFLAGS needed to\n    use the library.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070935 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(725,'c6469bfc32c0ebd53439b42feebc28439ac04506',13,'2011-02-15 15:40:18','    AVRO-744. C: Helper macros for extracting and setting record field values\n    \n    This patch adds two helper macros that can be used to extract or set the\n    value of a record field using fewer function calls.  It wraps a call to\n    avro_record_get, which extracts the avro_datum_t instance for the field,\n    and a call to avro_XXX_get or avro_XXX_set on the field datum.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1070941 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(726,'9075618bf7890a8761107fa96da92dedf73d8a3e',12,'2011-02-15 21:49:20','    AVRO-759. Java: Fix NullPointerException when some but not all fields are aliased.  Contributed by Xiaolu Ye.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1071083 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(727,'1ab4eec4d462d7384045a6efec7da0973ca71492',11,'2011-02-16 01:12:35','    AVRO-762. Java: Bug in BinaryData.compare() with offset comparison.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1071117 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(728,'b366fd1f242f160f86d473cf3c883e8a5d4ac8e5',11,'2011-02-16 01:14:00','    AVRO-764. Java: Bug in BinaryData.compare() with offset comparison.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1071118 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(729,'f7e0c4a5c396077c936beedf145c6178167bc0ee',11,'2011-02-16 01:29:55','    AVRO-764. Java: Bug in BinaryData.compare() with offset comparison.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1071120 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(730,'bccc9984b80b6f94e92281767500632c77286eed',12,'2011-02-19 00:40:03','    AVRO-730. Java: Add set() and remove() methods to GenericData.Array. Contributed by Chase Bradford.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1072217 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(731,'dcbfacdced7d0a7b50edf39afc1c50c87b1dcd7a',5,'2011-02-20 18:23:18','    AVRO-711. JSON encoder and decoder for C++\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1072677 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(732,'1c5bbe95f612b841bfeec3880e660d1b6ec44fab',12,'2011-02-21 17:20:23','    AVRO-755. Java: Fix SpecificResponder to correctly handle message parameter lists that differ between client and server.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1073077 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(733,'a21cdcde9e3b9f9d203a441abce5b2e3aa2a583f',11,'2011-02-21 21:20:57','    AVRO-771. Java: Update dependency versions\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1073141 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(734,'6fccf353fcbf236c93f8afefdd20be5f7cd3fd5b',10,'2011-02-24 17:56:08','    AVRO-701 + AVRO-772: Extensions to HttpServer to let you specify bind address as well as add arbitrary Jetty connectors (useful for Avro HTTP RPC over SSL).\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074237 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(737,'9852becf651de1d845b1bf6e80ab2deeacbd6d9c',12,'2011-02-24 22:25:57','    AVRO-773. Java: Add no-arg constructor to AvroWrapper.  Contributed by Jan Prach.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074322 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(738,'690bcb19471a3e5bf201665b5a75c1247f021e1d',12,'2011-02-24 22:33:37','    AVRO-774. Java: Clean up repositories in pom.xml.  Contributed by Lars Francke.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074330 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(739,'82ba2e6a9320d3d81c0b9e9cdaa40f5be528ee3a',12,'2011-02-24 22:53:59','    AVRO-754. Java: Permit passing custom channel factory to NettyTransceiver.  Contributed by Bruno Dumon.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074338 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(740,'3962eec7f14fc83542437a50c49dcd2d4b481410',11,'2011-02-25 00:36:40','    AVRO-753. Java: Improve BinaryEncoder Performance.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074364 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(741,'5f561248fa164725ec1e7600124fa4aa65a81c9c',13,'2011-02-25 15:43:50','    AVRO-751. C: Store schema reference in datum instances\n    \n    We now keep track of which particular schema an avro_datum_t is an\n    instance of.  For primitive values, there\'s only one possible schema,\n    and so we don\'t store an explicit reference.  For compound values, the\n    datum constructors now take in a schema parameter, which is stored in\n    the avro_datum_t instance.  For records, enums, and fixeds, this means\n    that we don\'t need to store the name of the schema type anymore, since\n    we can get this from the schema.\n    \n    There were also several functions, which operate on datum instances,\n    which needed to take in a schema parameter — avro_datum_to_json, as an\n    example.  Those parameters aren\'t needed anymore, since the datum\n    carries a reference to its own schema already.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074585 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(743,'aa3e9607963bb35f9067d3539b8881fe154c14cb',13,'2011-02-25 16:08:41','    AVRO-463. C: Error messages\n    \n    This patch adds a new avro_strerror() function, which returns a string\n    describing the most recent Avro error.  Every function that can return\n    an error code has been updated to provide an error string.  In\n    particular, the avro_schema_from_json function now fills in the Avro\n    error string with any parse errors that result from an invalid JSON\n    string.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074608 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(744,'7f0c2f36e04d80eeca72df974c9c3eb6fb4c4914',13,'2011-02-25 16:17:56','    AVRO-762. C: Better schema resolution\n    \n    This patch adds a new class that implements Avro\'s schema resolution\n    rules.  Before, the writer and reader schemas were resolved each time a\n    datum was read from an Avro file.  Now, we can examine the two schemas\n    before reading and data values, and \"remember\" the resolution result in\n    a tree of avro_resolver_t objects.  The avro_resolver_new function\n    creates this tree of resolvers.  The result is an instance of a generic\n    \"consumer\" interface, which is an abstract API for consuming Avro data\n    that conforms to some writer schema.  In this case, the resolver\n    implementation of the consumer API fills in an avro_datum_t that\n    conforms to the reader schema, promoting data and dropping fields as\n    necessary.  The avro_consume_binary function takes care of parsing the\n    Avro binary encoding, passing off the data that it reads in to a\n    consumer.\n    \n    We currently don\'t support the AVRO_LINK schema type; we\'ll need to add\n    some memoization to handle recursive schemas properly.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074612 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(745,'474cd6bb4632dc0bec91e9f4ec2707673cf96890',13,'2011-02-25 16:19:42','    AVRO-762. C: Promotion of values during schema resolution\n    \n    The avro_resolver_new function now takes into the schema promotion\n    rules: an int can be read as a long, float, or double; a long can be\n    read as a float or double; and a float can be read as a double.  The\n    test_avro_data test program includes test cases for each of these\n    promotions.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074614 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(746,'3e897246bf0cb958aa80ca1749fdf3514a8fd2b6',13,'2011-02-25 16:22:55','    AVRO-762. C: Recursive schema resolution\n    \n    The avro_resolver_new function now works correctly with recursive\n    schemas.  We had to memoize the results of avro_resolver_new, so that we\n    can detect when we\'ve already created an avro_resolver_t instance for a\n    pair of schemas.  This prevents us from going into an infinite loop\n    trying to resolve a recursive schema.\n    \n    This memoization means that there might be multiple references to a\n    resolver within the graph of resolvers for a recursive schema type.\n    When freeing this graph of resolvers, we now have to take care to only\n    free each instance once.  We do this by maintaining a set of the\n    resolvers that we\'ve already encountered during the free operation, and\n    immediately returning if we try to start freeing a resolver object a\n    second time.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074618 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(747,'16987f2bbedcc310a29e000b2ee72685170727be',13,'2011-02-25 20:33:27','    AVRO-762. C: Fixed segfault in avro_schema_from_json\n    \n    We were extracting the parse error text incorrectly from the Jansson\n    library error struct, which led to a segfault on certain platforms.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074687 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(748,'196a252b6657068013d76e903b1f90ad33ad5c8e',13,'2011-02-25 21:15:49','    AVRO-766. C: Skip valgrind check for now\n    \n    AVRO-766 describes a memory leak bug with recursive schemas.  Until we\n    commit a fix to this bug, we\'re going to turn off the valgrind tests in\n    our test suite.  We\'ll turn this back on once we have a fix for the\n    memory leak.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074702 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(749,'3b5d0336153495e29ee42605e6b11fa27a3fec5b',12,'2011-02-25 23:45:30','    AVRO-769. Java: Align Decoder/Encoder APIs.  Contributed by scottcarey.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1074751 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(825,'1b144474a26da6ea77d8d959a8b4dc8b07896cb4',12,'2011-03-07 20:12:47','    AVRO-726. Java: Make GenericDatum{Reader,Writer} easier to extend.  Contributed by scottcarey.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1078917 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(826,'ad935798984a24a6e9e9d2c136ff06a93b761ead',12,'2011-03-08 00:55:57','    AVRO-775. Java: Fix a file handle leak in DataFileReader.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1079055 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(760,'b96f626cc38ba3f3318f2e2e522b1ceeda037eb4',12,'2011-03-08 00:56:54','    Merge -c 1079055 from trunk to 1.5 branch.  Fixes AVRO-775.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/branches/branch-1.5@1079057 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(827,'16f9fbc19a28d6c22e6a8fe8550ff5801b853d0b',12,'2011-03-08 01:01:17','    AVRO-761. Java: Fix Requestor to not send client\'s protocol redundantly.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1079060 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(761,'639d6f2316a36225dcc18d75cea283c37eebfe96',12,'2011-03-08 01:02:33','    Merge -c 1079060 from trunk to 1.5 branch.  Fixes AVRO-761.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/branches/branch-1.5@1079061 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(830,'49681761a71ee17e1f554e3a411860a28a91fa18',14,'2011-03-09 07:00:58','    Avro-776. Java: SocketServer holds socket open after close.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1079680 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(831,'addcbe199d2fe5fbc690554c2309b947f5dd3d54',5,'2011-03-19 18:14:03