3767714',14,'2011-05-03 21:15:52','    Avro-815. Netty Transceiver fails processing one-way messages\n    \n    Implemented writeBuffers call in the NettyTranceiver to send a NettyDataPack similar to the request/response call. Added one-way\n    message definition to the test mail.avpr protocol file and updated unit test to verify the one-way behavior.\n    \n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1099257 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(862,'fbab55fdd499dae4736f099111aecf2bc8e488e3',13,'2011-05-12 14:57:27','    AVRO-818. C: Fix data file corruption bug\n    \n    This patch fixes the C library\'s data file writer to produce correct\n    files when there are enough records to produce multiple blocks in the\n    file.  The logic in datafile.c is that we have a fixed-buffer in-memory\n    avro_writer_t instance.  When you append records to the data file, they\n    go into this memory buffer.  If we get an error serializing into the\n    memory buffer, it\'s presumably because we\'ve filled it, so we write out\n    the memory buffer\'s contents as a new block in the file, clear the\n    buffer, and try again.\n    \n    The problem is that the failed serialization into the memory buffer\n    isn\'t atomic; some of the serialization will have made it into the\n    buffer before we discover that there\'s not enough room.  Before, this\n    incomplete record would then make it into the file.  To fix this, we\n    keep track of the size of the in-memory buffer after the most recent\n    successfully serialized record, and use this as the block size when we\n    write a block to disk.  This ensures that even if there\'s any incomplete\n    records at the end of the memory buffer, we don\'t include them in the\n    block.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1102332 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(863,'947bd7daab9ac512bba06f09d27f9dd29b55bef7',13,'2011-05-12 15:06:02','    AVRO-819. C: Fix file reader EOF detection\n    \n    This patch fixes a bug that Miki Tebeka discovered in the file reader\n    code.  Errors weren\'t getting propagated correctly through the call\n    stack.  This caused the file reader to not correctly detect EOF, and so\n    you\'d loop through the final block in a file twice.  (The second time\n    through, we wouldn\'t fill in the datum instance.)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1102335 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(866,'e05d7e823c8b05c18d4245b894eb43db66df21b6',12,'2011-05-18 09:25:18','    AVRO-809.  Fix reflect for classes that have no package.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1124127 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(789,'19674f6c6f234d74255d8037493905f0acdd75a2',12,'2011-05-18 09:30:55','    Merge -c 1124127 from trunk to 1.5 branch.  Fixes AVRO-809.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/branches/branch-1.5@1124134 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(868,'ea05ebd20d8ae1fc7e6cdfa64c6a40c204d728fe',12,'2011-05-19 15:50:40','    AVRO-820. Java: Permit applications to catch exceptions thrown while writing data to a file and then continue writing to that file.  Contributed by scottcarey.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1124971 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(790,'7531554db608e4083db3db59f48c74f0488fb7dc',12,'2011-05-19 15:53:04','    Merge -c 1124971 from trunk to 1.5 branch.  Fixes: AVRO-820.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/branches/branch-1.5@1124972 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(869,'b65bfcf9cf6004ae8c2cff0cd58e251032e4c719',12,'2011-05-30 08:27:54','    AVRO-830.  Java: Add AvroTextOutputFormat to permit Hadoop streaming jobs to easily write Avro format output with bytes as schema.  Contributed by Tom White.\n    \n    git-svn-id: https://svn.apache.or