fb31535491912f55a658d4f0291fb5',13,'2011-09-25 20:03:25','    AVRO-894. C: Fixed CHANGES.txt\n    \n    I described this fix as being in the released version 1.5.4, which isn\'t\n    true.  Moved this up to the unreleased section.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1175561 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(935,'e1fa71998aa7ecbf230b7b5dc8af8b446a2870f1',13,'2011-09-25 20:47:26','    AVRO-865. C: Upgrade Jansson to 2.1.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1175570 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(937,'27493bbf6257f48278df922517bc9e38be2df8d2',13,'2011-09-26 12:36:26','    AVRO-863. C: Schema resolution using new value interface\n    \n    This patch adds the avro_resolved_reader_t and avro_resolved_writer_t\n    classes, which handle schema resolution using the new avro_value_t\n    interface.  The resolved reader type wraps an existing value as the\n    \"writer schema\" side of schema resolution, and provides a view into the\n    wrapped value as if it were an instance of the reader schema.  The\n    resolved writer type does the inverse; it wraps an instance of the\n    reader schema, and lets you write into that value as if it were an\n    instance of the writer schema.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1175832 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(938,'7a1cdae26c92bb14e63ac71eab4ee7ce3859752b',13,'2011-09-26 13:12:46','    AVRO-893. C: Avro data file functions using value API\n    \n    The functions for reading and writing the contents of an Avro data file\n    have now been ported to the new value API.  The structure of the new\n    functions is the same as before; we just read from or write into an\n    avro_value_t instead of an avro_datum_t.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1175854 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(939,'fd02845b1307edba65587a6e