nary stream is interpreted as end-of-stream\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1182347 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(964,'6e774f574bc75ade354423dadacfa9dd6aa5ff2b',5,'2011-10-12 13:15:18','    AVRO-869. Lifetimes of streams and encoder/decoders not managed propertly\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1182350 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(965,'122353642cc8ca30c04908f20e7636b342c30a0d',5,'2011-10-12 13:26:55','    AVRO-840. C++ generate nullable types for optional fields int the schema\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1182355 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(966,'883f32a9d1060d6578176efcc974ae453fc38e72',5,'2011-10-12 15:58:17','    AVRO-915. Large number of warnings in C++ buildsc\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1182454 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(967,'287f348e2e331ebfca808275413585dd99e6865f',5,'2011-10-12 17:11:22','    AVRO-913. CMake/C++ build should work for out-of-tree builds\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1182482 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(968,'8fad411325a514d8dbf782c2a15ec169f3e428e6',5,'2011-10-14 03:52:53','    AVRO-925. CMake/C++ Unable to build debug version of libavrocpp\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183217 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(969,'5c7076df6a213fb62838a246fa061a34d24858fa',13,'2011-10-15 13:24:14','    AVRO-928. Debug statement no longer reports garbage from stack\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183632 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(970,'acbb703c989806356d7edb1d7ff563c913a5cb0e',13,'2011-10-15 13:30:08','    AVRO-919. C: Produce JSON encoding for Avro values\n    \n    This patch adds an avro_value_to_json function, which produces the JSON\n    encoding on an Avro value.  This is a pretty basic translation of the\n    existing avro_datum_to_json function, which has been modified to use the\n    new value API.  The avro_datum_to_json function is now implemented using\n    the datum type\'s value wrapper.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183634 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(971,'d5e1e385ce6464c2c95e1d3aaab7b5d015bf3e81',13,'2011-10-15 13:34:24','    AVRO-920. C: Reusable memory I/O objects\n    \n    The avro_reader_t and avro_writer_t subclasses that work with memory\n    regions are now reusable; you can reset an existing reader or writer\n    object to point at a new memory region, or to simply reset to the\n    beginning of the current memory region.  This lets you more easily reuse\n    these objects when encoding and decoding large numbers of values.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183635 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(972,'c909aa17c9f592da6db3dffc3505e91af7545b86',13,'2011-10-15 13:36:40','    AVRO-921. C: Default wrapped buffer implementation is zero-copy\n    \n    The avro_wrapped_buffer_new_copy function creates a default\n    implementation of the wrapped buffer interface.  It creates a copy of\n    the data pointer that\'s passed in, which the wrapped buffer has full\n    control over.  Before, the wrapped buffer implementation would create\n    futher copies of the underlying buffer whenever the copy() method was\n    called.  Now, the wrapped buffer\'s copy is reference counted, and the\n    copy() and free() methods avoid making extra copies.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183637 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(973,'0c0a454e4e06cb35fb9db9d5054684f8ea6c16fd',13,'2011-10-15 13:38:44','    AVRO-922. C: Value comparison function\n    \n    This patch adds the avro_value_cmp and avro_value_cmp_fast functions,\n    which compare two avro_value_t instances using the sort order from the\n    Avro specification.  Like the avro_value_equal and avro_value_copy\n    methods, we don\'t require the two values to have the same value\n    implementation, but they do need to be instances of the same schema.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183638 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(974,'29fa142825a7b094abb61475e2f787ca3495a316',13,'2011-10-15 14:08:45','    AVRO-474. C: Add source package target to CMake build files\n    \n    The CMake build scripts can now produce a source tarball, via CPack.\n    After running cmake in your build directory, \"make package_source\" will\n    produce the source tarball.  The only caveat is that CPack doesn\'t try\n    to be smart about what to include in the tarball; basically anything in\n    the top-level source directory is included.  I\'ve added some ignore\n    patterns to keep out some of the obvious riff-raff like backup files,\n    and the CMake build directory.  But to produce a truly pristine source\n    tarball, you should make sure to keep the source directory itself\n    pristine.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183643 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(975,'35f6ce9cbc8cbba05efe70a3578bc78ef29da594',13,'2011-10-15 14:22:30','    AVRO-929. C: Set install_name in shared library on Mac OS X\n    \n    CMake will automatically call the install_name_tool program for us if we\n    set the CMAKE_INSTALL_NAME_DIR variable.  We now automatically set this\n    variable if we\'re running on Mac OS X, and it\'s not set already.  Its\n    default value is \"${CMAKE_INSTALL_PREFIX}/lib\".\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183648 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(976,'67142f000666b7bb8f344dcd45b0b2608457226d',13,'2011-10-15 14:32:45','    AVRO-468. C: Document CMake build system\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1183649 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(977,'9eed34dac2bc0203e2e42242d08e90b96fc56fbb',5,'2011-10-17 06:58:53','    AVRO-932. C++ build.sh should have an option to install the built software\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185024 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(978,'b4bd442ba87dddefa58143a9793b31df3cb7e708',5,'2011-10-17 07:03:33','    AVRO-931. Avro C++ \"make install\" does not install the code generator\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185025 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(979,'fc986ce223a13e88c11d611c6d3870d023e99d08',5,'2011-10-17 07:14:12','    AVRO-918. Avro C++ documentation is very old\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185027 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(980,'6310f6945fd409d27bc1347e993d8dab5c5da8f1',5,'2011-10-17 12:45:11','    AVRO-918. Avro C++ documentation is very old\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185130 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(981,'ee35b2176aa020353549c1877052094f0cbd35ac',5,'2011-10-17 12:50:33','    AVRO-933. On latest Ubuntu AvrogencppTests.cc does not compile\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185133 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(982,'60c0c5450755ee4dc21d3e6cb575f9291bc7656e',12,'2011-10-17 20:43:12','    AVRO-924. Java: Support reading & writing arbitrary JSON data using an efficient Avro binary representation.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185364 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(983,'db12764c2637364addfb835b783533460d49a159',12,'2011-10-17 20:47:25','    AVRO-927. Java: Fix Pair#equals() to better compare schemas.  Contributed by Brock Noland.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1185367 13f79535-47bb-0310-99