11-12-13 19:44:37','    AVRO-960. C: const char parameters for set_string and set_string_len\n    \n    The avro_value_set_string and avro_value_set_string_len input parameters\n    are now \"const char *\" instead of \"char *\".  This is change is backwards\n    compatible, since everything that compiled previously will still compile\n    without errors or warnings.  Contributed by Lucas Martin-King.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1213895 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1033,'09e1155948e295b9fed27bf76d57125d75063726',13,'2011-12-13 19:54:32','    AVRO-968. C: avro_value_cmp now compares string values correctly\n    \n    Before, we weren\'t extracting the contents of string values in\n    avro_value_cmp and avro_value_cmp_fast, so you\'d get a garbage result.\n    Contributed by Vivek Nadkarni.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1213898 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1034,'2d4458383bd8a4a99da25171525ae9716061a339',12,'2011-12-16 19:35:35','    AVRO-982. Java: Fix NettyTransceiver to not hang when server stops.  Contributed by Bruno Dumon.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1215248 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1035,'9aed3b71c2e80014f8d3239273304a761891dd16',13,'2011-12-20 02:09:23','    AVRO-961. C: avrocat/pipe use stdin when no file is specified.\n    \n    The avrocat and avropipe commands will now read an Avro data file from\n    stdin if you don\'t provide a filename on the command line.  Contributed\n    by Michael Cooper.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1221072 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1036,'fdcb6c279bbc966d0d919333de43aa2f849d62e0',13,'2011-12-20 02:27:44','    AVRO-957. C: Codec support\n    \n    The C library now supports reading and writing Avro data files that have\n    compressed data blocks.  We currently support the deflate and lzma\n    codecs.  The codec API is nice and modular, so it should be easy to add\n    snappy as well.  Contributed by Michael Cooper and Lucas Martin-King.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1221076 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1038,'2874dfde27e4390f9b2510629dacff9d2db409d6',13,'2011-12-27 15:14:49','    AVRO-984. C: Resolved reader initializes complex array values correctly.\n    \n    Before, we weren\'t initialize new values when they were appended to an\n    array in the resolved reader class.  For arrays of primitives, this\n    wasn\'t a problem, since you don\'t really need to initialize primitives.\n    For arrays of arrays (and other complex element types), however, the\n    elements need to be properly initialized before they can be used.\n    (Contributed by Vivek Nadkarni.)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1224924 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1039,'ebbcdcacd48ecb210a165de2d149582c87baca85',15,'2012-01-17 15:27:18','    AVRO-994. Java: TestFileSpanStorage.testTonsOfSpans() fails on my slow VM.\n    \n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1232442 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1040,'d72dafc3e20c310271e45acb371529e18e0c2fc4',15,'2012-01-17 18:00:56','    Update CHANGES.txt with author of AVRO-994\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1232512 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1041,'40b2a8672349cad661cf53f07d52d2219585e2fb',15,'2012-01-17 19:42:22','    AVRO-993. Java: Add methods back to GenericDatumReader that were removed in AVRO-839.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1232552 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1042,'b180bd8ab188342dc989740e082e2bf3487882fa',12,'2012-01-23 23:26:39','    AVRO-926. Java: Fix tests to pass under JDK 7.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1235061 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1043,'b4ad6eb2375b93bfafde60fef3df4d1df021141b',12,'2012-01-23 23:31:51','    AVRO-1000. Java: Remove incompatible implementations of equals() and hashCode() from GenericData.Array.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1235064 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1044,'c31563877d3ce82dda14d553d1132fecacc87c86',12,'2012-01-23 23:43:26','    AVRO-854.  Python: Permit DataFileWriter and DataFileReader to be used as context managers in with statements.  Contributed by Harsh J.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1235069 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1045,'2af5295264a8d9fb13f5aa18ed860b67e51703b9',12,'2012-01-24 21:35:12','    AVRO-1002.  Fix a broken link in the specification.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1235512 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1046,'cef41283f2b5efd606d4a810e021218ee15a9fd9',13,'2012-01-26 13:59:22','    AVRO-1003. C: Fix pkg-config file when codecs are missing.\n    \n    If either of the zlib or lzma/xz libraries are missing, then we need to\n    ensure that the corresponding substitution variable in our pkg-config\n    file gets an empty value.  Otherwise CMake leaves the variable\n    unsubstituted, which gives us an invalid pkg-config file.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1236181 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1047,'2681d58693dcf0c7987307e939e3c551880e93d3',13,'2012-01-26 14:02:11','    AVRO-1004. C: avropipe: Don\'t display NUL terminators for string values.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1236182 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1048,'dbab66b91b879c902e700a0ca9bbdd48696cbf5b',13,'2012-01-26 16:47:31','    AVRO-986. C/Java: Fixed relates to sync markers in file headers.\n    \n    The C bindings no longer add an \"avro.sync\" entry to the header of an\n    Avro file.  (Previously, the Java bindings (at least) would barf if this\n    sync marker was present, since they\'d treat that as the end of the file\n    header.)  The Java bindings now ignore the extra sync marker, if\n    present.\n    \n    In addition, this patch adds a new \"avromod\" command-line utility to the\n    C bindings.  This utility can be used (among other things) to remove the\n    sync marker from the header of an existing file.  It works by copying\n    all of the records from a source file to a destination file.  You can\n    also override the block size and compression codec of the new\n    destination file.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1236284 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1049,'f36a3b4bb5e9bc58f9bbe4579f8db2dd60ae45a3',13,'2012-02-01 17:38:31','    AVRO-1014. C: Check for errors producing JSON output in avrocat.\n    \n    Contributed by Lucas Martin-King.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1239227 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1050,'c0d9d5c0be6ac5627f3a2009acb46840fc7305b4',5,'2012-02-02 19:11:25','    AVRO-956. Remove dependency on Flex/Bison\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1239768 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1052,'29f8701a42d172cf4b9a2a474000d509f34a2d46',15,'2012-02-07 07:23:55','    AVRO-996. Java: SpecificRecord builder pattern object copy fails with unions in some cases.\n    \n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1241366 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1053,'70e19ce67e3ade7237663097c1952ed32f6b16b2',11,'2012-02-07 19:25:09','    AVRO-1011. Improve POM structure. (Lars Francke via scottcarey)\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1241561 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1054,'044c065e73bd04f639e7f2