hema_from_json_length\n    \n    We now explicitly document that the length and error parameters are\n    unused in the avro_schema_from_json function.  (The error parameter\n    isn\'t needed, since any errors parsing or interpreting the JSON text are\n    available using the avro_strerror() function.)\n    \n    This patch also adds the new avro_schema_from_json_length function.\n    This function actually uses its length parameter, and we explicitly\n    document that the length should *not* include any NUL terminator, if one\n    is present.  We also provide the avro_schema_from_json_literal helper\n    macro, which automatically calculates the size of a literal JSON string\n    at compile time.  (To work, the JSON string must be defined as a char[],\n    not a char *.)\n    \n    We decided to fix this bug using a new function because there\'s existing\n    code out there that\'s already assuming that avro_schema_from_json\'s len\n    parameter is unused.  (Or at least, they\'re assuming different things\n    about what kind of value to pass in.)  This solution ensures that\n    existing code still works, while providing a new function for the\n    (needed) non-NUL-terminated case.  It comes at the expense of a sloppy\n    signature for the existing avro_schema_from_json function...but then,\n    the signature was already sloppy.  We\'re at least not adding any *new*\n    sloppiness.\n    \n    We also now use the new avro_schema_from_json_length function when\n    reading an Avro object container file.  This means that we no longer\n    need to append a NUL terminator to the schema JSON when reading in the\n    container file\'s header.  (We don\'t *need to*, but we still do.  One\n    change at a time.)\n    \n    Contributed by Michael Cooper, modified by dcreager\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1242603 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1077,'9869e9b5db2e54a072f46cebf7044fcfbd8ca166',12,'2012-02-22 22:49:15','    AVRO-1030. Fix a broken link in the documentation.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1292566 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1078,'61b059be57010a44023474ff40242a5c6e32ec75',11,'2012-02-24 22:43:32','    AVRO-1037. Problems using Avro 1.6.2 with Hadoop (CDH3 or 1.0)\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1293464 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1079,'17aec14ebba7764fb20cf4745157788dfcfe78ab',12,'2012-02-24 23:47:15','    AVRO-1036.  Fix a regression in IDL imports created by AVRO-971.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1293481 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1080,'6de7a277f7c58af8f5d831176951291cd2d87d81',13,'2012-02-29 01:24:29','    AVRO-1031. C: avro_value_cmp doesn\'t necessarily return {-1,0,1}.\n    \n    The avro_value_cmp function uses memcmp under the covers (at least for\n    comparing bytes values), and so it doesn\'t necessarily return only -1,\n    0, and 1 as results.  Rather, any negative value can be used for the\n    less-than case, and any positive value for the greater-than case.  This\n    patch updates our unit tests to not assume too much about the return\n    value.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1294928 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1081,'a77a88d8b2afbfd3bf57546aa03a0c4f56699426',13,'2012-02-29 01:33:03','    AVRO-1033. C: Fix x86 assembly implementation of reference count primitives.\n    \n    There was a typo in the assembly implementation of our reference\n    counting primitives.  (Vivek Nadkarni via dcreager)\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1294932 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1082,'8f779e177336039e695e4e4c97a8e152ed6ea815',13,'2012-03-01 03:52:24','    AVRO-1038. C: Require GCC 4.5.0 to use GCC atomic intrinsics.\n    \n    Vivek has found a couple of platforms where the GCC atomic instrinsics\n    aren\'t available in 4.1.0.  We can fall back on the raw assembly\n    implementations our supported platforms, so for now, we\'re going to bump\n    the required GCC version to 4.5.0.  We\'ll eventually want to replace\n    this with an autotools-style runtime check in our CMake files, or a more\n    complex preprocessor check.\n    \n    Contributed by Vivek Nadkarni.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1295400 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1083,'0ad579a6276a75f018d60be364534ad2d142db69',13,'2012-03-01 03:54:53','    AVRO-1039. C: Don\'t try to use nonexistent codecs in test cases.\n    \n    The quickstop example was hard-coded to use the deflate codec, even if\n    we\'re not building that codec.  The null codec will always be there, so\n    we fall back on that if we don\'t have deflate.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1295401 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1084,'523d2de7141ff2e6a3416a0e04a647a4283e3d8f',13,'2012-03-01 04:01:09','    AVRO-1034. C: Resolved reader initializes child array.\n    \n    The resolved reader array implementation now initializes its children\n    array.  We only need to initialize the elements of the array when\n    they\'re first created.  This happens the first time we access a\n    particular element, or any element that appears after it in the array.\n    \n    Test case contributed by Vivek Nadkarni.\n    \n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1295404 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1085,'98b14a071b3e5b6aa7c694731099f72ae22a3473',12,'2012-03-02 21:50:20','    AVRO-1041. Java: Fix Utf8 to reuse array in more cases.  Contributed by Dave Irving.\n    \n    git-svn-id: https://svn.apache.org/repos/asf/avro/trunk@1296486 13f79535-47bb-0310-9956-ffa450edef68\n',1,NULL,1),(1086,'c9dfafb695b7d7b3e4f637e0f9af862c6dad8a28',12,'2012